import MintServiceABI from '../contracts/MintService.json';

const contractMintService = (web3) => {
    const setContractA = async() => {
        const mintService = new web3.eth.Contract(
          MintServiceABI, '0x306a271F178aD37083cDA734F3Aca694FF301B0F'
        )
        const connectedChainNetwork = await web3.eth.getChainId();
        return [mintService, connectedChainNetwork];
    }
}

export default contractMintService;
